import logo from './logo.svg';
import './App.css';

function App() {
  var word = "ideology";
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Testing word: {word}
        </p>
        <p>
          {word} is from {wordToEtymology()}
        </p>
      </header>
    </div>
  );
}

function wordToEtymology()
{
  return ("Old English");
}

export default App;
